// src/components/Projects.js
import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import index from './images/indexbanner.jpg';
import unity1 from './images/unity1.png';
import unity2 from './images/unity2.png';
import unity3 from './images/unity3.png';
import blizzardui from './images/blizzardui.png';
import neonnights from './images/neonnights.png';
import mobileapp from './images/mobile%app%design';
import unityui2 from './images/unityui2';
import unityui from '/images/unityui';

const Projects = () => {
  useEffect(() => {
    const track = document.getElementById("image-track");

    const handleOnDown = (e) => (track.dataset.mouseDownAt = e.clientX);

    const handleOnUp = () => {
      track.dataset.mouseDownAt = "0";
      track.dataset.prevPercentage = track.dataset.percentage;
    };

    const handleOnMove = (e) => {
      if (track.dataset.mouseDownAt === "0") return;

      const mouseDelta = parseFloat(track.dataset.mouseDownAt) - e.clientX,
        maxDelta = window.innerWidth / 2;

      const percentage =
        (mouseDelta / maxDelta) * -100,
        nextPercentageUnconstrained =
          parseFloat(track.dataset.prevPercentage) + percentage,
        nextPercentage = Math.max(
          Math.min(nextPercentageUnconstrained, 0),
          -100
        );

      track.dataset.percentage = nextPercentage;

      track.animate(
        {
          transform: `translate(${nextPercentage}%, -50%)`,
        },
        { duration: 1200, fill: "forwards" }
      );

      for (const image of track.getElementsByClassName("image")) {
        image.animate(
          {
            objectPosition: `${100 + nextPercentage}% center`,
          },
          { duration: 1200, fill: "forwards" }
        );
      }
    };

    /* -- Had to add extra lines for touch events -- */

    window.onmousedown = (e) => handleOnDown(e);

    window.ontouchstart = (e) => handleOnDown(e.touches[0]);

    window.onmouseup = (e) => handleOnUp(e);

    window.ontouchend = (e) => handleOnUp(e.touches[0]);

    window.onmousemove = (e) => handleOnMove(e);

    window.ontouchmove = (e) => handleOnMove(e.touches[0]);

    // Clean up event listeners when the component is unmounted
    return () => {
      window.onmousedown = null;
      window.ontouchstart = null;
      window.onmouseup = null;
      window.ontouchend = null;
      window.onmousemove = null;
      window.ontouchmove = null;
    };
  }, []); // Empty dependency array ensures the effect runs only once

  return (
    <div id="header1">
      <section className="header">
        <img src={index} className="back-video" alt="Background Video" />
        <nav>
          <div className="nav-links" id="navLinks">
            <i className="fa fa-times"></i>
            <ul>
              <li><Link to="/">HOME </Link></li>
              <li><Link to="/about">ABOUT ME </Link></li>
              <li><Link to="/skills">PORTFOLIO </Link></li>
              <li><Link to="/projects">PROJECTS </Link></li>
              <li><Link to="/contact">CONTACT </Link></li>
            </ul>
          </div>
          <i className="fa fa-bars"></i>
        </nav>
        <div className="text-box">
          
        </div>
      </section>
      <section className="portfolio" id="portfolio">
        <img src="./images/indexbanner.jpg" className="back-video" alt="Background Video" />
        <nav>
          <div className="nav-links" id="navLinks">
            <i className="fa fa-times"></i>
            <ul>
              <li><a href="index.html">HOME</a></li>
              <li><a href="about.html">ABOUT ME</a></li>
              <li><a href="skills.html">PORTFOLIO</a></li>
              <li><a href="projects.html">PROJECTS</a></li>
              <li><a href="contact.html">CONTACT ME</a></li>
            </ul>
          </div>
          <i className="fa fa-bars"></i>
        </nav>
        <div id="image-track" data-mouse-down-at="0" data-prev-percentage="0">
          <img className="image" src={unity1} draggable="false" alt="Unity Image 1" />
          <img className="image" src="images/unity2.png" draggable="false" alt="Unity Image 2" />
          <img className="image" src="images/unity3.png" draggable="false" alt="Unity Image 3" />
          <img className="image" src="images/blizzardui.png" draggable="false" alt="Blizzard UI Image" />
          <img className="image" src="images/neonnights.png" draggable="false" alt="Neon Nights Image" />
          <img className="image" src="images/mobile%20app%20design.png" draggable="false" alt="Mobile App Design Image" />
          <img className="image" src="images/unityui2.png" draggable="false" alt="Unity UI Image 2" />
          <img className="image" src="images/unityui.png" draggable="false" alt="Unity UI Image" />
          <img className="image" src="images/project2.png" draggable="false" alt="Project Image 2" />
          <img className="image" src="images/project1.png" draggable="false" alt="Project Image 1" />
        </div>
      </section>
    </div>
  );
};

export default Projects;
